import React, { useState } from 'react';
import {usePeer} from '../Provider/PeerProvider'

export default function Call(props) {

    const [peerID , setPeerID] = useState("")
    const myPeer = usePeer()

    const handleX = ()=>{
        props.setDisplay("Home")
    }

    return( 
        <div className="Call">
            <div className="wrapper fadeInDown">
                <div id="formContent">
                    <h3 id="peerID" className="active fadeIn first" >{peerID}</h3>
                    <button onClick={handleX} className="fadeIn first">X</button>
                    <div className="fadeIn second" id="video-grid">
                        <video id="me"></video>
                        <video id="friend"></video>
                        <PeerJs smyPeer={myPeer} setPeerID={setPeerID} roomID={props.roomID} socket={props.socket} ID={props.ID} />
                   </div>
                </div>
            </div>
        </div>
    )
}
